import { Component, OnInit } from '@angular/core';

import { UsuariosService} from "../services/usuarios.service";
import {AuthService} from "../services/auth.service";
import * as jsPDF from "jspdf";
import {EvaluacionesService} from "../services/evaluaciones.service";

@Component({
  selector: 'app-ver',
  templateUrl: './ver.component.html',
  styleUrls: ['./ver.component.css']
})
export class VerComponent implements OnInit {


  evaluacionesRespondidas:any = [];


  constructor(private _auth:AuthService,private uService : UsuariosService,private eService: EvaluacionesService) {
    this.traerEvaluacionesRespondidas();
  }

  downloadPDF(elm,data){
    let doc = new jsPDF();
    let content = document.getElementById(elm);

    console.log(data);


    doc.setFontSize(40);
    doc.text(35, 40, data.infoEvaluacion[0].nombre);
    doc.setFontSize(15);
    doc.text(35, 60, "RUT: "+data.idUsuario);

    doc.fromHTML(content.innerHTML,15,65,{});
    doc.addImage("data:image/jpeg;base64,","JPEG",150,0,60,25);
    doc.addImage("data:image/png;base64,","JPEG",15,180,100,100);

    doc.save("Evaluacion"+elm);


    /*doc.fromHTML(content.innerHTML,15,15,{});

    doc.save("Evaluacion"+elm);
*/

  }

  sendPDF(data){

    this.eService.enviarCorreoPDF(data).subscribe(d=>{});


  }



  ngOnInit() {
  }

  traerEvaluacionesRespondidas(){
    this.uService.evaluacionesPorRut(this._auth.decode().rut).subscribe((d:any)=>{
      this.evaluacionesRespondidas = d.evaluaciones;
    });
  }

}
